CREATE DEFINER=`root`@`localhost` PROCEDURE `SpAlertaReservacion`()
BEGIN
select res.Id, per.nombre Nombre, per.Correo, (select GROUP_CONCAT(Destino) from destinoreservacionvehiculo where IdReservacion=res.Id) Destino, res.FechaInicio, res.FechaFin,fnBuscaVehiculo(res.idvehiculo) Unidad, res.Alerta, '1 Hora Antes' Mensaje from reservacionvehiculo res inner join personal per on res.IdEmpleado=per.idEmpleado where res.Alerta=1 AND res.AlertaEnviada=FALSE AND (res.Estado=0 or res.Estado=1) and TIMEDIFF(res.FechaInicio, Now())<='01:00:00'
union
select res.Id, per.nombre Nombre, per.Correo, (select GROUP_CONCAT(Destino) from destinoreservacionvehiculo where IdReservacion=res.Id) Destino, res.FechaInicio, res.FechaFin,fnBuscaVehiculo(res.idvehiculo) Unidad, res.Alerta, '1 DÃ­a Antes' Mensaje from reservacionvehiculo res inner join personal per on res.IdEmpleado=per.idEmpleado where Alerta=2 AND AlertaEnviada=FALSE AND (Estado=0 or Estado=1) and DATEDIFF(FechaInicio, Now())<='1'
union
select res.Id, per.nombre Nombre, per.Correo, (select GROUP_CONCAT(Destino) from destinoreservacionvehiculo where IdReservacion=res.Id) Destino, res.FechaInicio, res.FechaFin,fnBuscaVehiculo(res.idvehiculo) Unidad, res.Alerta, '1 Semana Antes' Mensaje from reservacionvehiculo res inner join personal per on res.IdEmpleado=per.idEmpleado where Alerta=3 AND AlertaEnviada=FALSE AND (Estado=0 or Estado=1) and DATEDIFF(FechaInicio, Now())<='7';
