CREATE DEFINER=`root`@`localhost` PROCEDURE `SpProductoCajaChica`(_Codigo VARCHAR(50))
BEGIN
if _Codigo='' or _Codigo='%' then
    select codigo,descripcion from inventario where CContable in('050','060');
else
    select codigo,descripcion from inventario where (codigo like concat('%',_Codigo,'%') or descripcion like concat('%',_Codigo, '%')) and CContable in('050','060');
end if;
END ;;
